First, we translate $z$ so that $c$ is at the origin.  This is done by subtracting $c$ from $z,$ which gives us $z - c = 2 + \sqrt{2} - (3 + 3 \sqrt{2})i - (2 - 3i) = \sqrt{2} - 3 \sqrt{2} i.$

[asy]
unitsize(0.6 cm);

pair C, W, Z;

Z = (2 + sqrt(2), -3 - 3*sqrt(2));
C = (2,-3);
W = rotate(45,C)*(Z);

draw(Z--C--W);

dot("$c$", C, N);
dot("$w$", W, SE);
dot("$z$", Z, S);
label("$\frac{\pi}{4}$", C + (0.6,-1));
[/asy]

Rotating a complex number by $\frac{\pi}{4}$ is the same as multiplying it by $e^{i \pi/4} = \frac{1 + i}{\sqrt{2}}.$  Thus, the complex number we want is
\[(\sqrt{2} - 3 \sqrt{2} i) \cdot \frac{1 + i}{\sqrt{2}} = (1 - 3i)(1 + i) = 4 - 2i.\]Finally, we translate back by adding $c$ to get $4 - 2i + 2 - 3i = \boxed{6 - 5i}.$

