Let $x = \angle BAC,$ so $\angle BDC = 3x.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);
draw(C--D--B--A);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
label("$x$", (A + B)/2, NW, red);
label("$3x$", (B + D)/2, NW, red);
label("$3x$", (D + C)/2, NE, red);
label("$3x$", (C + A)/2, NE, red);
[/asy]

Since $\angle BAC = x,$ $\angle ABC = \angle ACB = \frac{180^\circ - x}{2} = 90^\circ - \frac{x}{2}.$

Since $\angle BDC = 3x,$ $\angle BDA = \angle CDA = \frac{180^\circ - 3x}{2} = 90^\circ - \frac{3x}{2}.$

Since $\angle ADB = 180^\circ - \angle BDA - \angle A = 180^\circ - (90^\circ - \frac{3x}{2}) - x = 90^\circ - \frac{x}{2},$ triangle $ABD$ is isosceles, so $BD = AB = AC.$

Since $\angle ADC = 180^\circ - \angle CDA - \angle A = 180^\circ - (90^\circ - \frac{3x}{2}) - x = 90^\circ + \frac{x}{2},$ triangle $ACD$ is isosceles, so $CD = AC = AB.$

Therefore, $AB = AC = BD = CD,$ so $ABCD$ is a rhombus.

Since $AM$ is a diagonal of rhombus $ABCD,$ $AM$ bisects $\angle BAD,$ so $\angle BAM = \frac{x}{2}.$

Since $AM$ is a diagonal of rhombus $ABCD,$ $AM$ bisects $\angle CAD,$ so $\angle CAM = \frac{x}{2}.$

Therefore, $\angle BAC = x = \angle BAM + \angle CAM = \frac{x}{2} + \frac{x}{2} = x,$ so $x = 30^\circ.$

Therefore, $\angle BAC = 30^\circ,$ $\angle ABC = \angle ACB = 75^\circ,$ and $\angle BDC = 90^\circ.$

