Since $\angle BAC = 30^\circ,$ $\angle ABC = 75^\circ,$ and $\angle BCA = 75^\circ,$ triangle $ABC$ is isosceles, so $AB = AC.$

Since $AB = AC,$ triangle $ABC$ is equilateral, so $AB = BC = AC.$

Since $AM = 11,$ $AB = AC = 22.$

Therefore, the perimeter of triangle $ABC$ is $3 \cdot 22 = \boxed{66}.$
